import React from 'react';
import './Breadcrum.css';
import Arrow_icon from '../Assets/breadcrum_arrow.png';

const Breadcrum = (props) => {
    const { product } = props;
    return (
        <div className='Breadcrum'>
            <a href="/">Home</a> <img src={Arrow_icon} alt="arrow icon" />
            <a href="/shop">Shop</a> <img src={Arrow_icon} alt="arrow icon" />
            <span>{product.category}</span> <img src={Arrow_icon} alt="arrow icon" />
            <span>{product.name}</span>
        </div>
    );
}

export default Breadcrum;
